'Brainstorming'=>'Brainstorming',
'GetStartedBrainstorming'=>'Dette første skrittet er viktig- tenk på ditt affiliateprogram.<br/>
Du bør ha en plan over hva du ønsker å oppnå. Hvor store provisjoner har du råd til?<br/>
Vil de være attraktive sammenlignet med hva konkurrentene byr?
