'Review your settings'=>'Se gjennom dine innstillinger',
'GetStartedSettings'=>'Post Affiliate Pro er laget på en måte som kan fungere sammen med standard konfigurasjon.<br/>Uansett, du bør uansett sjekke konfigurasjonen og fintune den for ditt eget behov.<br/>Du finner konfigurasjonen under <strong>Konfigurasjon & Verktøy menyen -> Konfigurasjon</strong>.<br/><br/>Den detaljerte forklaringen for alle innstillingsvalgene er tilgjengelig i vår user\'s guide eller knowledgebase.',
'Define your commissions'=>'Definer dine provisjoner',
'GetStartedCommissions'=>'En standard kampanje blir opprettet under installasjonen. Du kan endre den eller opprette dine egne kampanjer.<br/><br/>
Kampanjer brukes for å gruppere sett av produkter (eller ett enkelt produkt) som har samme provisjonsinnstilling.<br/><br/>
For eksempel, du kan ha kampanje for Produkt1, hvor du belønner dine affiliater per klikk, og en annen kampanje for Produkt2, hvor affiliatene mottar provisjon per salg.<br/><br/>
Eller du kan ha kampanjer for lavprisprodukter, som har 40% av ordreverdien per salg, og en siste kampanje for dyrere produkter med 15% per salg.',
'Add banners and other creatives'=>'Legg til bannere og andre creatives',
'GetStartedCreatives'=>'I <strong>Administrer banner</strong> kan du ha alt fra tekstlinker, bildebannere, til flash, html og ferdige forslag til reklame via epost.<br/>
Hver banner må ha en destinasjons URL spesifisert - det er URL den besøkende sendes etter et klikk.',
'Set up emails'=>'Sett opp epost',
'GetStartedEmails'=>'Du bør sette opp epostfunksjonalitet. Dette inkluderer: <ul><li><strong>epostkonto</strong> - hvordan epost blir sendt. Du kan velge enten mail() funksjon eller SMTP server.</li><li><strong>epost templater</strong> – dette er templater som brukes av systemet når epost sendes automatisk, for eksempel etter påmelding, eller etter salg</li><li><strong>epostvarslinger</strong> – du kan konfigurere hvilke varslinger du vil motta som merchant, og hvilke som er tilgjengelige for affiliater.</li></ul>Pass på at epostkontoer setter opp ordentlig – test å sende epost. Uten et fungerende epostsystem, vil ikke affiliater motta viktig informasjon.',
'Customize your affiliate signup form'=>'Tilpass ditt affiliate påmeldingsskjema',
'GetStartedSignupForm'=>'Sjekk ut standard påmeldingsskjema, og tilpass det hvis du vil.<br/><br/>
Påmeldingsskjemaet kommer med en informativ mini-side som inneholder informasjon om programmet<br/>Du kan bruke mini-siden, eller slette det og lage ditt eget.',
'Customize affiliate panel'=>'Tilpass affiliate kontrollpanel',
'GetStartedAffPanel'=>'Affiliate panel i Post Affiliate Pro er veldig fleksibelt.<br/>Du kan konfigurere hvordan du vil at menyen skal se ut, hvilket innhold du ønsker, og til og med skrive eget innhold eller linke til andre sider.',
'GetStartedIntegrate'=>'Integrasjon er en metode å koble affiliatesystemet til din webside, handlevogn eller betalingsterminal, på en måte som varsler affiliatesystemet om all aktivitet.<br/>
<br/><br/>
Integrasjon betyr vanligvis at du legger til noen få linjer mede kode på dine websider, og det er forklart trinn for trinn i integrasjonsveilederen for de vanligste nettbutikker og betalingsløsninger. ',
'Test everything'=>'Test alt sammen',
'GetStartedTest'=>'Når du har konfigurert dine kampanjer, definert korrekt provisjon, og opprettet noen bannere og linker, bør du teste systemet.<br/>
Det beste er å simulere hele prosessen sett fra dine affiliaters ståsted:
<ol>
<li>Opprett noen testaffiliater – etter at de er godkjent bør du motta epost som bekrefter påmeldingen inkludert passord, test om du kan logge inn i systemet</li>
<li>Logg inn i affiliatenes panel, se koden for bannere og linker og putt dem på en testside</li> 
<li>Klikk på banneren for å se om klikket blir registrert</li>
<li>Etter klikket, prøv å gjøre et testsalg og sjekk om salget og provisjonen ble registrert av systemet</li>
</ol>

Hvis du erfarer problemer under disse testene, aktiver <strong>Debug hendelseslogging</strong> og se på <strong>Problemløsning</strong>',
'Promote your affiliate program'=>'Reklamer for ditt affiliateprogram',
'GetStartedPromote'=>'Etter at du har testet integrasjonen av affiliatesystemet med din webside, er alt klart for å reklamere for ditt nye affiliatesystem, for å tiltrekke nye affiliater å melde seg på.<br/><br/>
Det er påkrevd å sette en link til påmeldingsskjemaet fra din egen webside, slik at nye affiliater finner det. Navngi linken Affiliate program Dette vil tiltrekke de besøkende og du kan konvertere dem til affiliater.<br/><br/>
For å nå flere potensielle affiliater, legg ut ditt program i affiliatekataloger på nettet.',
